const depthFirstSearch = (source: IItem[]) => {
  const result: string[] = []; // \u5B58\u653E\u7ED3\u679C\u7684\u6570\u7EC4
  // \u9012\u5F52\u65B9\u6CD5
  const dfs = (data: IItem[]) => {
    // \u904D\u5386\u6570\u7EC4
    data.forEach((element: IItem) => {
      // \u5C06\u5F53\u524D\u8282\u70B9 id \u5B58\u653E\u8FDB\u7ED3\u679C
      result.push(element.id);
      // \u5982\u679C\u5F53\u524D\u8282\u70B9\u6709\u5B50\u8282\u70B9\uFF0C\u5219\u9012\u5F52\u8C03\u7528
      if (element.children && element.children.length > 0) {
        dfs(element.children);
      }
    });
  };
  // \u5F00\u59CB\u641C\u7D22
  dfs(source);
  return result;
};

